   ELEMENTAL FUNCTION ONUMM20N2_LOG(X) RESULT(RES)

      TYPE(ONUMM20N2), INTENT(IN) :: X
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM20N2) :: RES
      
      DER0 = LOG(X%R)
      DER1 = 1D0/X%R
      DER2 = -1/X%R**2

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM20N2_LOG

   ELEMENTAL FUNCTION ONUMM20N2_POW_OR(X,E) RESULT(RES)

      TYPE(ONUMM20N2), INTENT(IN) :: X
      REAL(DP), INTENT(IN) :: E
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM20N2) :: RES
      
      DER0=0.0d0
      DER1=0.0d0
      DER2=0.0d0
      
      DER0 = X%R**E
      IF ((E-0)/=0.0d0) THEN
         DER1 = E*X%R**(E - 1)
         IF ((E-1)/=0.0d0) THEN
            DER2 = E*X%R**(E - 2)*(E - 1)
         END IF
      END IF

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM20N2_POW_OR

   ELEMENTAL FUNCTION ONUMM20N2_POW_RO(E,X) RESULT(RES)

      TYPE(ONUMM20N2), INTENT(IN) :: X
      REAL(DP), INTENT(IN) :: E
      REAL(DP) :: DER0,DER1,DER2
      TYPE(ONUMM20N2) :: RES
      
      
      DER0 = E**X%R
      DER1 = E**X%R*LOG(E)
      DER2 = E**X%R*LOG(E)**2

      RES = FEVAL(X,DER0,DER1,DER2)

   END FUNCTION ONUMM20N2_POW_RO

   ELEMENTAL FUNCTION ONUMM20N2_F2EVAL(X,Y,DER0_0,DER1_0,DER1_1, &
                                   DER2_0,DER2_1,DER2_2)&
      RESULT(RES)
      IMPLICIT NONE
      !  Definitions
      REAL(DP) :: COEF, DELTA
      TYPE(ONUMM20N2), INTENT(IN)  :: X,Y
      REAL(DP), INTENT(IN)  :: DER0_0,DER1_0,DER1_1, &
                               DER2_0,DER2_1,DER2_2
      TYPE(ONUMM20N2) :: RES
      TYPE(ONUMM20N2) :: DX, DY

      COEF   = 0.0_DP
      DX     = X
      DY     = Y

      !  Set real part of deltas zero.
      DX%R = 0.0_DP
      DY%R = 0.0_DP

      ! Set real part
      RES = DER0_0

      ! Set order 1
      COEF = DER1_0 / 1.0_DP
      RES = RES + COEF*DX

      COEF = DER1_1 / 1.0_DP
      RES = RES + COEF*DY

      

      ! Set order 2
      COEF = DER2_0 / 2.0_DP
      RES = RES + COEF*DX*DX

      COEF = DER2_1 / 1.0_DP
      RES = RES + COEF*DX*DY

      COEF = DER2_2 / 2.0_DP
      RES = RES + COEF*DY*DY

      

   END FUNCTION ONUMM20N2_F2EVAL


   ELEMENTAL FUNCTION ONUMM20N2_POW_OO(X,Y) RESULT(RES)

      TYPE(ONUMM20N2), INTENT(IN) :: X, Y
      REAL(DP) :: DER0_0,DER1_0,DER1_1,DER2_0,DER2_1,DER2_2
      TYPE(ONUMM20N2) :: RES
      
      DER0_0 = X%R**Y%R
      DER1_0 = X%R**Y%R*Y%R/X%R
      DER1_1 = X%R**Y%R*LOG(X%R)
      DER2_0 = X%R**Y%R*Y%R*(Y%R - 1)/X%R**2
      DER2_1 = X%R**Y%R*(Y%R*LOG(X%R) + 1)/X%R
      DER2_2 = X%R**Y%R*LOG(X%R)**2

      RES = F2EVAL(X,Y,DER0_0,DER1_0,DER1_1,DER2_0,DER2_1,DER2_2)

   END FUNCTION ONUMM20N2_POW_OO


   FUNCTION ONUMM20N2_INV2X2(A,det)&
      RESULT(RES)
      IMPLICIT NONE
      TYPE(ONUMM20N2) , INTENT(IN) :: A(2,2) 
      TYPE(ONUMM20N2) , INTENT(IN), OPTIONAL :: det
      REAL(DP) :: detCalc
      TYPE(ONUMM20N2) :: RES(SIZE(A,1),SIZE(A,2)) 

      IF (PRESENT(det)) THEN
         detCalc=det%R
      ELSE
         detCalc=det2x2(A%R)
      END IF

      ! Get real part 
      RES%R=INV2X2(A%R,detCalc)

      ! Order 1
      RES%E1=-MATMUL(RES%R,(MATMUL(A%E1,RES%R)))
      RES%E2=-MATMUL(RES%R,(MATMUL(A%E2,RES%R)))
      RES%E3=-MATMUL(RES%R,(MATMUL(A%E3,RES%R)))
      RES%E4=-MATMUL(RES%R,(MATMUL(A%E4,RES%R)))
      RES%E5=-MATMUL(RES%R,(MATMUL(A%E5,RES%R)))
      RES%E6=-MATMUL(RES%R,(MATMUL(A%E6,RES%R)))
      RES%E7=-MATMUL(RES%R,(MATMUL(A%E7,RES%R)))
      RES%E8=-MATMUL(RES%R,(MATMUL(A%E8,RES%R)))
      RES%E9=-MATMUL(RES%R,(MATMUL(A%E9,RES%R)))
      RES%EA=-MATMUL(RES%R,(MATMUL(A%EA,RES%R)))
      RES%EB=-MATMUL(RES%R,(MATMUL(A%EB,RES%R)))
      RES%EC=-MATMUL(RES%R,(MATMUL(A%EC,RES%R)))
      RES%ED=-MATMUL(RES%R,(MATMUL(A%ED,RES%R)))
      RES%EE=-MATMUL(RES%R,(MATMUL(A%EE,RES%R)))
      RES%EF=-MATMUL(RES%R,(MATMUL(A%EF,RES%R)))
      RES%EG=-MATMUL(RES%R,(MATMUL(A%EG,RES%R)))
      RES%EH=-MATMUL(RES%R,(MATMUL(A%EH,RES%R)))
      RES%EI=-MATMUL(RES%R,(MATMUL(A%EI,RES%R)))
      RES%EJ=-MATMUL(RES%R,(MATMUL(A%EJ,RES%R)))
      RES%EK=-MATMUL(RES%R,(MATMUL(A%EK,RES%R)))

      ! Order 2
      RES%E11=-MATMUL(RES%R,(MATMUL(A%E11,RES%R)+MATMUL(A%E1,RES%E1)))
      RES%E12=-MATMUL(RES%R,(MATMUL(A%E12,RES%R)+MATMUL(A%E1,RES%E2)+&
             MATMUL(A%E2,RES%E1)))
      RES%E22=-MATMUL(RES%R,(MATMUL(A%E22,RES%R)+MATMUL(A%E2,RES%E2)))
      RES%E13=-MATMUL(RES%R,(MATMUL(A%E13,RES%R)+MATMUL(A%E1,RES%E3)+&
             MATMUL(A%E3,RES%E1)))
      RES%E23=-MATMUL(RES%R,(MATMUL(A%E23,RES%R)+MATMUL(A%E2,RES%E3)+&
             MATMUL(A%E3,RES%E2)))
      RES%E33=-MATMUL(RES%R,(MATMUL(A%E33,RES%R)+MATMUL(A%E3,RES%E3)))
      RES%E14=-MATMUL(RES%R,(MATMUL(A%E14,RES%R)+MATMUL(A%E1,RES%E4)+&
             MATMUL(A%E4,RES%E1)))
      RES%E24=-MATMUL(RES%R,(MATMUL(A%E24,RES%R)+MATMUL(A%E2,RES%E4)+&
             MATMUL(A%E4,RES%E2)))
      RES%E34=-MATMUL(RES%R,(MATMUL(A%E34,RES%R)+MATMUL(A%E3,RES%E4)+&
             MATMUL(A%E4,RES%E3)))
      RES%E44=-MATMUL(RES%R,(MATMUL(A%E44,RES%R)+MATMUL(A%E4,RES%E4)))
      RES%E15=-MATMUL(RES%R,(MATMUL(A%E15,RES%R)+MATMUL(A%E1,RES%E5)+&
             MATMUL(A%E5,RES%E1)))
      RES%E25=-MATMUL(RES%R,(MATMUL(A%E25,RES%R)+MATMUL(A%E2,RES%E5)+&
             MATMUL(A%E5,RES%E2)))
      RES%E35=-MATMUL(RES%R,(MATMUL(A%E35,RES%R)+MATMUL(A%E3,RES%E5)+&
             MATMUL(A%E5,RES%E3)))
      RES%E45=-MATMUL(RES%R,(MATMUL(A%E45,RES%R)+MATMUL(A%E4,RES%E5)+&
             MATMUL(A%E5,RES%E4)))
      RES%E55=-MATMUL(RES%R,(MATMUL(A%E55,RES%R)+MATMUL(A%E5,RES%E5)))
      RES%E16=-MATMUL(RES%R,(MATMUL(A%E16,RES%R)+MATMUL(A%E1,RES%E6)+&
             MATMUL(A%E6,RES%E1)))
      RES%E26=-MATMUL(RES%R,(MATMUL(A%E26,RES%R)+MATMUL(A%E2,RES%E6)+&
             MATMUL(A%E6,RES%E2)))
      RES%E36=-MATMUL(RES%R,(MATMUL(A%E36,RES%R)+MATMUL(A%E3,RES%E6)+&
             MATMUL(A%E6,RES%E3)))
      RES%E46=-MATMUL(RES%R,(MATMUL(A%E46,RES%R)+MATMUL(A%E4,RES%E6)+&
             MATMUL(A%E6,RES%E4)))
      RES%E56=-MATMUL(RES%R,(MATMUL(A%E56,RES%R)+MATMUL(A%E5,RES%E6)+&
             MATMUL(A%E6,RES%E5)))
      RES%E66=-MATMUL(RES%R,(MATMUL(A%E66,RES%R)+MATMUL(A%E6,RES%E6)))
      RES%E17=-MATMUL(RES%R,(MATMUL(A%E17,RES%R)+MATMUL(A%E1,RES%E7)+&
             MATMUL(A%E7,RES%E1)))
      RES%E27=-MATMUL(RES%R,(MATMUL(A%E27,RES%R)+MATMUL(A%E2,RES%E7)+&
             MATMUL(A%E7,RES%E2)))
      RES%E37=-MATMUL(RES%R,(MATMUL(A%E37,RES%R)+MATMUL(A%E3,RES%E7)+&
